B.U2=A.a(s(["\u062c: \u0642\u0627\u0644: \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0623\u064e\u0643\u0652\u0645\u064e\u0644\u064f \u0627\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e \u0625\u0650\u064a\u0645\u064e\u0627\u0646\u064b\u0627 \u0623\u064e\u062d\u0652\u0633\u064e\u0646\u064f\u0647\u064f\u0645\u0652 \u062e\u064f\u0644\u064f\u0642\u064b\u0627\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u062a\u0631\u0645\u0630\u064a \u0648\u0623\u062d\u0645\u062f.","\u062c- \u0661- \u0644\u0623\u0646\u0647\u0627 \u0633\u0628\u0628 \u0644\u0645\u062d\u0628\u0629 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n\u0662- \u0648\u0633\u0628\u0628 \u0644\u0645\u062d\u0628\u0629 \u0627\u0644\u062e\u0644\u0642.\n\u0663- \u0648\u0647\u064a \u0623\u062b\u0642\u0644 \u0634\u064a\u0621 \u0641\u064a \u0627\u0644\u0645\u064a\u0632\u0627\u0646.\n\u0664- \u0648\u062a\u0636\u0627\u0639\u0641 \u0627\u0644\u0623\u062c\u0631 \u0648\u0627\u0644\u062b\u0648\u0627\u0628 \u0628\u062d\u0633\u0646 \u0627\u0644\u062e\u0644\u0642.\n\u0665- \u0648\u0639\u0644\u0627\u0645\u0629 \u0639\u0644\u0649 \u0643\u0645\u0627\u0644 \u0627\u0644\u0625\u064a\u0645\u0627\u0646.","\n                    \u062c- \u0645\u0646 \u0627\u0644\u0642\u0631\u0622\u0646 \u0627\u0644\u0643\u0631\u064a\u0645\u060c \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0647\u064e\u0630\u064e\u0627 \u0627\u0644\u0652\u0642\u064f\u0631\u0652\u0622\u064e\u0646\u064e \u064a\u064e\u0647\u0652\u062f\u0650\u064a \u0644\u0650\u0644\u0651\u064e\u062a\u0650\u064a \u0647\u0650\u064a\u064e \u0623\u064e\u0642\u0652\u0648\u064e\u0645\u064f\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0625\u0633\u0631\u0627\u0621: \u0669]. \u0648\u0645\u0646 \u0627\u0644\u0633\u0646\u0629 \u0627\u0644\u0646\u0628\u0648\u064a\u0629: \u062d\u064a\u062b \u0642\u0627\u0644 \u0631\u0633\u0648\u0644\u064f \u0627\u0644\u0644\u0647\u0650 \ufdfa : \xab\u0625\u0646\u0651\u064e\u0645\u0627 \u0628\u064f\u0639\u0650\u062b\u0652\u062a\u064f \u0644\u0650\u0623\u064f\u062a\u064e\u0645\u0651\u0650\u0645\u064e \u0635\u0627\u0644\u062d\u064e \u0627\u0644\u0623\u064e\u062e\u0644\u0627\u0642\u0650\xbb \u0631\u0648\u0627\u0647 \u0623\u062d\u0645\u062f.                    ","\n                    \u062c- \u0627\u0644\u0625\u062d\u0633\u0627\u0646: \u0647\u0648 \u0645\u0631\u0627\u0642\u0628\u0629 \u0627\u0644\u0644\u0647 \u0639\u0644\u0649 \u0627\u0644\u062f\u0648\u0627\u0645\u060c \u0648\u0628\u0630\u0644 \u0627\u0644\u062e\u064a\u0631 \u0648\u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0644\u0644\u0645\u062e\u0644\u0648\u0642\u064a\u0646.\n\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \ufdfa : \xab\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0643\u064e\u062a\u064e\u0628\u064e \u0627\u0644\u0652\u0625\u0650\u062d\u0652\u0633\u064e\u0627\u0646\u064e \u0639\u064e\u0644\u064e\u0649 \u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u064a\u0652\u0621\u064d\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.\n\u0645\u0646 \u0635\u0648\u0631 \u0627\u0644\u0625\u062d\u0633\u0627\u0646:\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646\u064f \u0641\u064a \u0639\u0650\u0628\u0627\u062f\u0629 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0648\u0630\u0644\u0643 \u0628\u0627\u0644\u0625\u062e\u0644\u0627\u0635 \u0641\u064a \u0639\u0628\u0627\u062f\u062a\u0647.\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0625\u0644\u0649 \u0627\u0644\u0648\u0627\u0644\u062f\u064e\u064a\u0646\u0650\u060c \u0628\u0627\u0644\u0642\u0648\u0644 \u0648\u0627\u0644\u0641\u0639\u0644.\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0625\u0644\u0649 \u0627\u0644\u0623\u0631\u062d\u0627\u0645 \u0648\u0627\u0644\u0623\u0642\u0627\u0631\u0628.\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0625\u0644\u0649 \u0627\u0644\u062c\u0627\u0631\u0650.\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0625\u0644\u0649 \u0627\u0644\u064a\u062a\u0627\u0645\u064e\u0649 \u0648\u0627\u0644\u0645\u064e\u0633\u0627\u0643\u064a\u0646.\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0625\u0644\u0649 \u0627\u0644\u0645\u064f\u0633\u064a\u0621 \u0625\u0644\u064a\u0643.\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0641\u064a \u0627\u0644\u0643\u0644\u0627\u0645.\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0641\u064a \u0627\u0644\u062c\u0650\u062f\u0627\u0644.\n\xb7\xa0\xa0\xa0\xa0 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0625\u0644\u0649 \u0627\u0644\u062d\u064a\u0648\u0627\u0646.                    ","\n                    \u062c- \u0636\u062f \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0627\u0644\u0625\u0633\u0627\u0621\u0629.\n* \u0648\u0645\u0646 \u0630\u0644\u0643: \u062a\u0631\u0643 \u0627\u0644\u0625\u062e\u0644\u0627\u0635 \u0641\u064a \u0639\u0628\u0627\u062f\u0629 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n* \u0648\u0639\u0642\u0648\u0642 \u0627\u0644\u0648\u0627\u0644\u062f\u064a\u0646.\n* \u0648\u0642\u0637\u0639 \u0627\u0644\u0623\u0631\u062d\u0627\u0645.\n* \u0648\u0633\u0648\u0621 \u0627\u0644\u062c\u0648\u0627\u0631.\n* \u0648\u062a\u0631\u0643 \u0627\u0644\u0625\u062d\u0633\u0627\u0646 \u0625\u0644\u0649 \u0627\u0644\u0641\u0642\u0631\u0627\u0621 \u0648\u0627\u0644\u0645\u0633\u0627\u0643\u064a\u0646 \u0648\u063a\u064a\u0631 \u0630\u0644\u0643 \u0645\u0646 \u0633\u064a\u0621 \u0627\u0644\u0623\u0642\u0648\u0627\u0644 \u0648\u0627\u0644\u0623\u0639\u0645\u0627\u0644.                    ","\n                    \u062c-\n\u0661- \u0623\u0645\u0627\u0646\u0629 \u0641\u064a \u062d\u0641\u0638 \u062d\u0642\u0648\u0642 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n\u0635\u0648\u0631\u0647\u0627: \u0627\u0644\u0623\u0645\u0627\u0646\u0629 \u0641\u064a \u0623\u062f\u0627\u0621 \u0627\u0644\u0639\u0628\u0627\u062f\u0627\u062a \u0645\u0646 \u0627\u0644\u0635\u0644\u0627\u0629\u060c \u0648\u0627\u0644\u0632\u0643\u0627\u0629\u060c \u0648\u0627\u0644\u0635\u064a\u0627\u0645\u060c \u0648\u0627\u0644\u062d\u062c\u060c \u0648\u063a\u064a\u0631\u0647\u0627 \u0645\u0645\u0627 \u0627\u0641\u062a\u0631\u0636 \u0627\u0644\u0644\u0647 \u0639\u0644\u064a\u0646\u0627.\n\u0662- \u0623\u0645\u0627\u0646\u0629 \u0641\u064a \u062d\u0641\u0638 \u062d\u0642\u0648\u0642 \u0627\u0644\u062e\u0644\u0642:\n\xb7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0645\u0646 \u062d\u0641\u0638 \u0623\u0639\u0631\u0627\u0636 \u0627\u0644\u0646\u0627\u0633.\n\xb7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0648\u0623\u0645\u0648\u0627\u0644\u0647\u0645.\n\xb7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0648\u062f\u0645\u0627\u0626\u0647\u0645.\n\xb7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0648\u0623\u0633\u0631\u0627\u0631\u0647\u0645\u060c \u0648\u062c\u0645\u064a\u0639 \u0645\u0627 \u0627\u0626\u062a\u0645\u0646\u0643 \u0639\u0644\u064a\u0647 \u0627\u0644\u0646\u0627\u0633.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0641\u064a \u0630\u0650\u0643\u0631 \u0635\u0650\u0641\u0627\u062a \u0627\u0644\u0645\u0641\u0644\u062d\u064a\u0646: \ufd3f\u0648\u064e\u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0647\u064f\u0645\u0652 \u0644\u0650\u0623\u064e\u0645\u064e\u0627\u0646\u064e\u0627\u062a\u0650\u0647\u0650\u0645\u0652 \u0648\u064e\u0639\u064e\u0647\u0652\u062f\u0650\u0647\u0650\u0645\u0652 \u0631\u064e\u0627\u0639\u064f\u0648\u0646\u064e 8\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0645\u0624\u0645\u0646\u0648\u0646: \u0668].                    ","\n                    \u062c- \u0627\u0644\u062e\u064a\u0627\u0646\u0629\u060c \u0648\u0647\u064a \u062a\u0636\u064a\u064a\u0639 \u062d\u0642\u0648\u0642 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0648\u062d\u0642\u0648\u0642 \u0627\u0644\u0646\u0627\u0633.\n\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0622\u064a\u064e\u0629\u064f \u0627\u0644\u0645\u064f\u0646\u0627\u0641\u0650\u0642\u0650 \u062b\u064e\u0644\u0627\u062b\u064c\xbb - \u0648\u0630\u0643\u0631 \u0645\u0646\u0647\u0627 - \xab\u0648\u0625\u0630\u0627 \u0627\u0624\u0652\u062a\u064f\u0645\u0650\u0646\u064e \u062e\u0627\u0646\u064e\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647.                    ","\n                    \u062c- \u0647\u0648 \u0627\u0644\u0625\u062e\u0628\u0627\u0631 \u0628\u0645\u0627 \u064a\u0637\u0627\u0628\u0642 \u0627\u0644\u0648\u0627\u0642\u0639 \u0623\u0648 \u0627\u0644\u0634\u064a\u0621 \u0639\u0644\u0649 \u0645\u0627 \u0647\u0648 \u0639\u0644\u064a\u0647.\n\u0648\u0645\u0646 \u0635\u0648\u0631\u0647:\n\u0627\u0644\u0635\u062f\u0642 \u0641\u064a \u0627\u0644\u062d\u062f\u064a\u062b \u0645\u0639 \u0627\u0644\u0646\u0627\u0633.\n\u0627\u0644\u0635\u062f\u0642 \u0641\u064a \u0627\u0644\u0648\u0639\u062f.\n\u0627\u0644\u0635\u062f\u0642 \u0641\u064a \u0643\u0644 \u0642\u0648\u0644 \u0648\u0639\u0645\u0644.\n\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0625\u0646\u0651\u064e \u0627\u0644\u0635\u0651\u0650\u062f\u0642\u064e \u064a\u064e\u0647\u0652\u062f\u064a \u0625\u0644\u0649 \u0627\u0644\u0628\u0650\u0631\u0651\u0650\u060c \u0648\u0625\u0646\u0651\u064e \u0627\u0644\u0628\u0650\u0631\u0651\u064e \u064a\u064e\u0647\u0652\u062f\u064a \u0625\u0644\u0649 \u0627\u0644\u062c\u0646\u0651\u064e\u0629\u0650\u060c \u0648\u0625\u0646\u0651\u064e \u0627\u0644\u0631\u0651\u064e\u062c\u0644\u064e \u0644\u064e\u064a\u064e\u0635\u0652\u062f\u064f\u0642\u064f \u062d\u062a\u0651\u064e\u0649 \u064a\u0643\u0648\u0646\u064e \u0635\u0650\u062f\u0651\u0650\u064a\u0642\u064b\u0627\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647.                    ","\n                    \u062c- \u0627\u0644\u0643\u0630\u0628\u060c \u0648\u0647\u0648 \u062e\u0644\u0627\u0641 \u0627\u0644\u062d\u0642\u064a\u0642\u0629\u060c \u0645\u0646 \u0630\u0644\u0643\u060c \u0627\u0644\u0643\u0630\u0628 \u0639\u0644\u0649 \u0627\u0644\u0646\u0627\u0633\u060c \u0648\u0627\u062e\u0644\u0627\u0641 \u0627\u0644\u0645\u0648\u0627\u0639\u064a\u062f\u060c \u0648\u0634\u0647\u0627\u062f\u0629 \u0627\u0644\u0632\u0648\u0631.\n\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \ufdfa : \xab\u0648\u0625\u0646\u0651\u064e \u0627\u0644\u0643\u0630\u0650\u0628\u064e \u064a\u064e\u0647\u0652\u062f\u064a \u0625\u0644\u0649 \u0627\u0644\u0641\u064f\u062c\u0648\u0631\u0650\u060c \u0648\u0625\u0646\u0651\u064e \u0627\u0644\u0641\u064f\u062c\u0648\u0631\u064e \u064a\u064e\u0647\u0652\u062f\u064a \u0625\u0644\u0649 \u0627\u0644\u0646\u0651\u064e\u0627\u0631\u0650\u060c \u0648\u0625\u0646\u0651\u064e \u0627\u0644\u0631\u0651\u064e\u062c\u0644\u064e \u0644\u064e\u064a\u064e\u0643\u0630\u0650\u0628\u064f \u062d\u062a\u0651\u064e\u0649 \u064a\u064f\u0643\u062a\u064e\u0628\u064e \u0639\u0646\u062f\u064e \u0627\u0644\u0644\u0647\u0650 \u0643\u0630\u0651\u064e\u0627\u0628\u064b\u0627\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647. \u0648\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0622\u064a\u0629\u064f \u0627\u0644\u0645\u064f\u0646\u0627\u0641\u0650\u0642\u0650 \u062b\u064e\u0644\u0627\u062b\u064c\xbb -\u0648\u0630\u0643\u0631 \u0645\u0646\u0647\u0627- \xab\u0625\u0630\u0627 \u062d\u062f\u0651\u064e\u062b\u064e \u0643\u064e\u0630\u064e\u0628\u064e\u060c \u0648\u0625\u0630\u0627 \u0648\u064e\u0639\u064e\u062f\u064e \u0623\u064e\u062e\u0644\u064e\u0641\u064e\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647.                    ","\n                    \u062c- - \u0627\u0644\u0635\u0628\u0631 \u0639\u0644\u0649 \u0637\u0627\u0639\u0629 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n- \u0627\u0644\u0635\u0628\u0631 \u0639\u0646 \u0627\u0644\u0645\u0639\u0635\u064a\u0629.\n- \u0627\u0644\u0635\u0628\u0631 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u062f\u0627\u0631 \u0627\u0644\u0645\u0624\u0644\u0645\u0629\u060c \u0648\u062d\u0645\u062f \u0627\u0644\u0644\u0647 \u0639\u0644\u0649 \u0643\u0644 \u062d\u0627\u0644.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0671\u0644\u0635\u0651\u064e\u0640\u0628\u0650\u0631\u0650\u064a\u0646\u064e 146\ufd3e [\u0633\u0648\u0631\u0629 \u0622\u0644 \u0639\u0645\u0631\u0627\u0646: \u0661\u0664\u0666]. \u0648\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0639\u062c\u064e\u0628\u064b\u0627 \u0644\u0623\u0645\u0652\u0631\u0650 \u0627\u0644\u0645\u0624\u0645\u0646\u0650 \u0625\u0646\u0651\u064e \u0623\u0645\u0652\u0631\u064e\u0647 \u0643\u0644\u0651\u064e\u0647\u064f \u062e\u064a\u0631\u064c\u060c \u0648\u0644\u064a\u0633 \u0630\u0644\u0643 \u0644\u0623\u062d\u062f\u064d \u0625\u0644\u0651\u064e\u0627 \u0644\u0644\u0645\u0624\u0645\u0646\u0650\u061b \u0625\u0646\u0652 \u0623\u0635\u0627\u0628\u064e\u062a\u0652\u0647\u064f \u0633\u064e\u0631\u0651\u064e\u0627\u0621\u064f \u0634\u0643\u064e\u0631\u064e \u0641\u0643\u0627\u0646 \u062e\u064a\u0631\u064b\u0627 \u0644\u0647\u060c \u0648\u0625\u0646\u0652 \u0623\u0635\u0627\u0628\u064e\u062a\u0652\u0647\u064f \u0636\u064e\u0631\u0651\u064e\u0627\u0621\u064f \u0635\u0628\u064e\u0631\u064e \u0641\u0643\u0627\u0646 \u062e\u064a\u0631\u064b\u0627 \u0644\u0647\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.                    ","\n                    \u062c- - \u0648\u0647\u0648 \u0639\u062f\u0645 \u0627\u0644\u0635\u0628\u0631 \u0639\u0644\u0649 \u0627\u0644\u0637\u0627\u0639\u0629\u060c \u0648\u0639\u062f\u0645 \u0627\u0644\u0635\u0628\u0631 \u0639\u0646 \u0627\u0644\u0645\u0639\u0635\u064a\u0629\u060c \u0648\u0627\u0644\u062a\u0633\u062e\u0637 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u062f\u0627\u0631 \u0628\u0627\u0644\u0642\u0648\u0644 \u0623\u0648 \u0627\u0644\u0641\u0639\u0644.\n\u0645\u0646 \u0635\u0648\u0631\u0647:\n\xa7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u062a\u064e\u0645\u0646\u0651\u0650\u064a \u0627\u0644\u0645\u0648\u062a\u0650.\n\xa7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0636\u0631\u0652\u0628\u064f \u0627\u0644\u062e\u064f\u062f\u0648\u062f\u0650.\n\xa7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0634\u064e\u0642\u0651\u064f \u0627\u0644\u062b\u0651\u0650\u064a\u0627\u0628\u0650.\n\xa7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0646\u064e\u0634\u0652\u0631\u064f \u0627\u0644\u0634\u0651\u064f\u0639\u0648\u0631\u0650.\n\xa7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0627\u0644\u062f\u0651\u064f\u0639\u0627\u0621\u064f \u0639\u0644\u0649 \u0627\u0644\u0646\u0641\u0633 \u0628\u0627\u0644\u0647\u0644\u0627\u0643.\n\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0627\u0644\u0652\u062c\u064e\u0632\u064e\u0627\u0621\u0650 \u0645\u064e\u0639\u064e \u0639\u0650\u0638\u064e\u0645\u0650 \u0627\u0644\u0652\u0628\u064e\u0644\u064e\u0627\u0621\u0650 \u0648\u064e\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0625\u0650\u0630\u064e\u0627 \u0623\u064e\u062d\u064e\u0628\u0651\u064e \u0642\u064e\u0648\u0652\u0645\u064b\u0627 \u0627\u0628\u0652\u062a\u064e\u0644\u064e\u0627\u0647\u064f\u0645\u0652\u060c \u0641\u064e\u0645\u064e\u0646\u0652 \u0631\u064e\u0636\u0650\u064a\u064e \u0641\u064e\u0644\u064e\u0647\u064f \u0627\u0644\u0631\u0651\u0650\u0636\u064e\u0627\u060c \u0648\u064e\u0645\u064e\u0646\u0652 \u0633\u064e\u062e\u0650\u0637\u064e \u0641\u064e\u0644\u064e\u0647\u064f \u0627\u0644\u0633\u0651\u064e\u062e\u064e\u0637\u064f\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u062a\u0631\u0645\u0630\u064a \u0648\u0627\u0628\u0646 \u0645\u0627\u062c\u0629.                    ","\n                    \u062c- \u0647\u0648 \u062a\u0639\u0627\u0648\u0646 \u0627\u0644\u0646\u0627\u0633 \u0641\u064a\u0645\u0627 \u0628\u064a\u0646\u0647\u0645 \u0639\u0644\u0649 \u0627\u0644\u062d\u0642 \u0648\u0627\u0644\u062e\u064a\u0631.\n\u0635\u0648\u0631 \u0627\u0644\u062a\u0639\u0627\u0648\u0646:\no\xa0 \u0627\u0644\u062a\u0639\u0627\u0648\u0646 \u0641\u064a \u0631\u062f \u0627\u0644\u062d\u0642\u0648\u0642.\no\xa0 \u0627\u0644\u062a\u0639\u0627\u0648\u0646 \u0641\u064a \u0631\u062f \u0627\u0644\u0638\u0627\u0644\u0645.\no\xa0 \u0627\u0644\u062a\u0639\u0627\u0648\u0646 \u0641\u064a \u0633\u062f \u062d\u0627\u062c\u0627\u062a \u0627\u0644\u0646\u0627\u0633 \u0648\u0627\u0644\u0645\u0633\u0627\u0643\u064a\u0646.\no\xa0 \u0627\u0644\u062a\u0639\u0627\u0648\u0646 \u0639\u0644\u0649 \u0643\u0644 \u062e\u064a\u0631.\no\xa0 \u0639\u062f\u0645 \u0627\u0644\u062a\u0639\u0627\u0648\u0646 \u0639\u0644\u0649 \u0627\u0644\u0625\u062b\u0645 \u0648\u0627\u0644\u0623\u0630\u0649 \u0648\u0627\u0644\u0639\u062f\u0648\u0627\u0646.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u062a\u064e\u0639\u064e\u0627\u0648\u064e\u0646\u064f\u0648\u0627 \u0639\u064e\u0644\u064e\u0649 \u0627\u0644\u0652\u0628\u0650\u0631\u0651\u0650 \u0648\u064e\u0627\u0644\u062a\u0651\u064e\u0642\u0652\u0648\u064e\u0649 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0639\u064e\u0627\u0648\u064e\u0646\u064f\u0648\u0627 \u0639\u064e\u0644\u064e\u0649 \u0627\u0644\u0652\u0625\u0650\u062b\u0652\u0645\u0650 \u0648\u064e\u0627\u0644\u0652\u0639\u064f\u062f\u0652\u0648\u064e\u0627\u0646\u0650 \u0648\u064e\u0627\u062a\u0651\u064e\u0642\u064f\u0648\u0627 \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0634\u064e\u062f\u0650\u064a\u062f\u064f \u0627\u0644\u0652\u0639\u0650\u0642\u064e\u0627\u0628\u0650 2\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0645\u0627\u0626\u062f\u0629: \u0662]. \u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0627\u0644\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u064f \u0644\u0650\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u0650 \u0643\u0627\u0644\u0652\u0628\u064f\u0646\u0652\u064a\u0627\u0646\u0650\u061b \u064a\u064e\u0634\u064f\u062f\u0651\u064f \u0628\u064e\u0639\u0652\u0636\u064f\u0647 \u0628\u064e\u0639\u0652\u0636\u064b\u0627\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647. \u0648\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0627\u0644\u0645\u064f\u0633\u0652\u0644\u0650\u0645\u064f \u0623\u064e\u062e\u064f\u0648 \u0627\u0644\u0645\u064f\u0633\u0652\u0644\u0650\u0645\u0650\u060c \u0644\u0627 \u064a\u064e\u0638\u0644\u0650\u0645\u064f\u0647\u060c \u0648\u0644\u0627 \u064a\u064f\u0633\u0652\u0644\u0650\u0645\u064f\u0647\u060c \u0648\u0645\u064e\u0646 \u0643\u0627\u0646 \u0641\u064a \u062d\u0627\u062c\u0629\u0650 \u0623\u064e\u062e\u0650\u064a\u0647\u0650\u060c \u0643\u0627\u0646 \u0627\u0644\u0644\u0647\u064f \u0641\u064a \u062d\u0627\u062c\u064e\u062a\u0650\u0647\u060c \u0648\u0645\u064e\u0646 \u0641\u064e\u0631\u0651\u064e\u062c\u064e \u0639\u0646 \u0645\u064f\u0633\u0652\u0644\u0650\u0645\u064d \u0643\u064f\u0631\u0652\u0628\u064e\u0629\u064b\u060c \u0641\u064e\u0631\u0651\u064e\u062c\u064e \u0627\u0644\u0644\u0647\u064f \u0639\u064e\u0646\u0647\u064f \u0643\u064f\u0631\u0652\u0628\u064e\u0629\u064b \u0645\u0650\u0646 \u0643\u064f\u0631\u064f\u0628\u0627\u062a\u0650 \u064a\u064e\u0648\u0645\u0650 \u0627\u0644\u0642\u0650\u064a\u0627\u0645\u0629\u0650\u060c \u0648\u0645\u064e\u0646 \u0633\u064e\u062a\u064e\u0631\u064e \u0645\u064f\u0633\u0652\u0644\u0650\u0645\u064b\u0627\u060c \u0633\u064e\u062a\u064e\u0631\u064e\u0647\u064f \u0627\u0644\u0644\u0647\u064f \u064a\u064e\u0648\u0645\u064e \u0627\u0644\u0642\u0650\u064a\u0627\u0645\u0629\u0650\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647.                    ","\n                    \u062c- \u0661- \u0627\u0644\u062d\u064a\u0627\u0621 \u0645\u0646 \u0627\u0644\u0644\u0647: \u064a\u0643\u0648\u0646 \u0628\u0623\u0646 \u0644\u0627 \u062a\u0639\u0635\u064a\u0647 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f.\n\u0662- \u0627\u0644\u062d\u064a\u0627\u0621 \u0645\u0646 \u0627\u0644\u0646\u0627\u0633: \u0648\u0645\u0646 \u0630\u0644\u0643 \u062a\u0631\u0643 \u0627\u0644\u0643\u0644\u0627\u0645 \u0627\u0644\u0641\u0627\u062d\u0634 \u0627\u0644\u0628\u0630\u064a\u0621 \u0648\u0643\u0634\u0641 \u0627\u0644\u0639\u0648\u0631\u0629.\n\u0642\u0627\u0644 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa : \xab\u0627\u0644\u0625\u0650\u064a\u0645\u0627\u0646\u064f \u0628\u0650\u0636\u0652\u0639\u064c \u0648\u0633\u064e\u0628\u0639\u0648\u0646\u064e\xbb - \u0623\u0648: \xab\u0628\u0650\u0636\u0652\u0639\u064c \u0648\u0633\u0650\u062a\u0651\u064f\u0648\u0646\u064e\xbb - \xab\u0634\u064f\u0639\u0652\u0628\u0629\u064b\u060c \u0623\u064e\u0639\u0652\u0644\u064e\u0627\u0647\u0627: \u0642\u064e\u0648\u0652\u0644\u064f: \u0644\u0627 \u0625\u0650\u0644\u064e\u0647\u064e \u0625\u0644\u0651\u064e\u0627 \u0627\u0644\u0644\u0647\u064f. \u0648\u0623\u064e\u062f\u0652\u0646\u0627\u0647\u0627: \u0625\u0650\u0645\u0627\u0637\u0629\u064f \u0627\u0644\u0623\u064e\u0630\u064e\u0649 \u0639\u0646\u0650 \u0627\u0644\u0637\u0651\u064e\u0631\u064a\u0642\u0650. \u0648\u0627\u0644\u062d\u064e\u064a\u0627\u0621\u064f \u0634\u064f\u0639\u0652\u0628\u0629\u064c \u0645\u0650\u0646\u064e \u0627\u0644\u0625\u0650\u064a\u0645\u0627\u0646\u0650\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.                    ","\n                    \u062c- - \u0631\u062d\u0645\u0629 \u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646 \u0648\u062a\u0648\u0642\u064a\u0631\u0647\u0645.\n- \u0631\u062d\u0645\u0629 \u0635\u063a\u0627\u0631 \u0627\u0644\u0633\u0646 \u0648\u0627\u0644\u0623\u0637\u0641\u0627\u0644.\n- \u0631\u062d\u0645\u0629 \u0627\u0644\u0641\u0642\u064a\u0631 \u0648\u0627\u0644\u0645\u0633\u0643\u064a\u0646 \u0648\u0627\u0644\u0645\u062d\u062a\u0627\u062c.\n- \u0631\u062d\u0645\u0629 \u0627\u0644\u062d\u064a\u0648\u0627\u0646 \u0628\u0623\u0646 \u062a\u0637\u0639\u0645\u0647 \u0648\u0644\u0627 \u062a\u0624\u0630\u064a\u0647.\n\u0645\u0646 \u0630\u0644\u0643 \u0642\u0648\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u062a\u064e\u0631\u064e\u0649 \u0627\u0644\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u064a\u0646\u064e \u0641\u064a \u062a\u064e\u0631\u0627\u062d\u064f\u0645\u0650\u0647\u0650\u0645 \u0648\u062a\u064e\u0648\u0627\u062f\u0651\u0650\u0647\u0650\u0645 \u0648\u062a\u064e\u0639\u0627\u0637\u064f\u0641\u0650\u0647\u0650\u0645 \u0643\u0645\u064e\u062b\u064e\u0644\u0650 \u0627\u0644\u062c\u064e\u0633\u064e\u062f\u0650\u060c \u0625\u0630\u0627 \u0627\u0634\u062a\u064e\u0643\u064e\u0649 \u0639\u064f\u0636\u0652\u0648\u064c \u062a\u064e\u062f\u0627\u0639\u064e\u0649 \u0644\u0647\u064f \u0633\u0627\u0626\u0650\u0631\u064f \u062c\u064e\u0633\u064e\u062f\u0650\u0647\u0650 \u0628\u0627\u0644\u0633\u0651\u064e\u0647\u064e\u0631\u0650 \u0648\u0627\u0644\u062d\u064f\u0645\u0651\u064e\u0649\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647. \u0648\u0642\u0627\u0644 \u0631\u0633\u0648\u0644\u064f \u0627\u0644\u0644\u0647\u0650 \ufdfa : \xab\u0627\u0644\u0631\u0651\u064e\u0627\u062d\u0650\u0645\u0648\u0646\u064e \u064a\u064e\u0631\u062d\u064e\u0645\u064f\u0647\u064f\u0645\u064f \u0627\u0644\u0631\u0651\u064e\u062d\u0645\u0646\u064f\u060c \u0627\u0631\u0652\u062d\u064e\u0645\u064f\u0648\u0627 \u0623\u0647\u0652\u0644\u064e \u0627\u0644\u0623\u064e\u0631\u0636\u0650\u060c \u064a\u064e\u0631\u062d\u064e\u0645\u064f\u0643\u064f\u0645\u0652 \u0645\u064e\u0646 \u0641\u064a \u0627\u0644\u0633\u0651\u064e\u0645\u0627\u0621\u0650\xbb \u0631\u0648\u0627\u0647 \u0623\u0628\u0648 \u062f\u0627\u0648\u062f \u0648\u0627\u0644\u062a\u0631\u0645\u0630\u064a.                    ","\n                    \u062c- \u0645\u062d\u0628\u0629 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0622\u064e\u0645\u064e\u0646\u064f\u0648\u0627 \u0623\u064e\u0634\u064e\u062f\u0651\u064f \u062d\u064f\u0628\u0651\u064b\u0627 \u0644\u0650\u0644\u0651\u064e\u0647\u0650\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: \u0661\u0666\u0665].\n\u0645\u062d\u0628\u0629 \u0627\u0644\u0631\u0633\u0648\u0644 \ufdfa .\n\u0642\u0627\u0644: \xab\u0648\u0627\u0644\u0651\u064e\u0630\u064a \u0646\u064e\u0641\u0652\u0633\u064a \u0628\u0650\u064a\u064e\u062f\u0650\u0647\u060c \u0644\u0627 \u064a\u064f\u0624\u0645\u0650\u0646\u064f \u0623\u062d\u062f\u064f\u0643\u0645 \u062d\u062a\u0651\u064e\u0649 \u0623\u0643\u0648\u0646\u064e \u0623\u062d\u0628\u0651\u064e \u0625\u0644\u064a\u0647\u0650 \u0645\u0650\u0646 \u0648\u0627\u0644\u0650\u062f\u0650\u0647 \u0648\u0648\u064e\u0644\u064e\u062f\u0650\u0647\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u0628\u062e\u0627\u0631\u064a.\n\u0645\u062d\u0628\u0629 \u0627\u0644\u0645\u0624\u0645\u0646\u064a\u0646\u060c \u0648\u0645\u062d\u0628\u0629 \u0627\u0644\u062e\u064a\u0631 \u0644\u0647\u0645 \u0643\u0645\u0627 \u062a\u062d\u0628\u0647 \u0644\u0646\u0641\u0633\u0643.\n\u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0644\u064e\u0627 \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f \u0623\u064e\u062d\u064e\u062f\u064f\u0643\u064f\u0645\u0652 \u062d\u064e\u062a\u0651\u064e\u0649 \u064a\u064f\u062d\u0650\u0628\u0651\u064e \u0644\u0650\u0623\u064e\u062e\u0650\u064a\u0647\u0650 \u0645\u064e\u0627 \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0644\u0650\u0646\u064e\u0641\u0652\u0633\u0650\u0647\u0650\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u0628\u062e\u0627\u0631\u064a.                    ","\n                    \u062c- \u0647\u064a \u0637\u0644\u0627\u0642\u0629\u064f \u0627\u0644\u0648\u064e\u062c\u0647\u0650\u060c \u0645\u0639 \u0627\u0644\u0641\u064e\u0631\u062d\u0650 \u0648\u0627\u0644\u062a\u0651\u064e\u0628\u0633\u0651\u064f\u0645\u0650 \u0648\u0627\u0644\u0644\u0637\u0641 \u0648\u0625\u0638\u0647\u0627\u0631 \u0627\u0644\u0633\u0631\u0648\u0631 \u0639\u0646\u062f \u0644\u0642\u0627\u0621 \u0627\u0644\u0646\u0627\u0633.\n\u0648\u0647\u064a \u0628\u0639\u0643\u0633 \u0627\u0644\u0639\u0628\u0648\u0633 \u0641\u064a \u0648\u062c\u0647 \u0627\u0644\u0646\u0627\u0633 \u0645\u0645\u0627 \u064a\u0646\u0641\u0631\u0647\u0645.\n\u0648\u0641\u064a \u0641\u0636\u0644 \u0630\u0644\u0643 \u062c\u0627\u0621\u062a \u0627\u0644\u0623\u062d\u0627\u062f\u064a\u062b\u060c \u0641\u0639\u0646 \u0623\u0628\u064a \u0630\u064e\u0631\u0651\u064d \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u060c \u0642\u0627\u0644: \u0642\u0627\u0644 \u0644\u064a\u064e \u0627\u0644\u0646\u0651\u064e\u0628\u064a\u0651\u064f \ufdfa : \xab\u0644\u0627 \u062a\u064e\u062d\u0652\u0642\u0650\u0631\u064e\u0646\u0651\u064e \u0645\u0650\u0646\u064e \u0627\u0644\u0645\u064e\u0639\u0631\u064f\u0648\u0641\u0650 \u0634\u064e\u064a\u0652\u0626\u064b\u0627\u060c \u0648\u0644\u0648 \u0623\u064e\u0646\u0652 \u062a\u064e\u0644\u0652\u0642\u064e\u0649 \u0623\u062e\u0627\u0643\u064e \u0628\u0650\u0648\u064e\u062c\u0652\u0647\u064d \u0637\u064e\u0644\u0652\u0642\u064d\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645. \u0648\u0642\u0627\u0644\u064e \u0631\u064e\u0633\u0648\u0644\u064f \u0627\u0644\u0644\u0647\u0650 \ufdfa : \xab\u062a\u064e\u0628\u064e\u0633\u0651\u064f\u0645\u064f\u0643\u064e \u0641\u0650\u064a \u0648\u064e\u062c\u0652\u0647\u0650 \u0623\u064e\u062e\u0650\u064a\u0643\u064e \u0644\u064e\u0643\u064e \u0635\u064e\u062f\u064e\u0642\u064e\u0629\u064c\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u062a\u0631\u0645\u0630\u064a.                    ","\n                    \u062c- \u0647\u0648 \u062a\u0645\u0646\u064a \u0632\u0648\u0627\u0644 \u0627\u0644\u0646\u0639\u0645\u0629 \u0639\u0646 \u0627\u0644\u063a\u064a\u0631 \u0623\u0648 \u0643\u0631\u0627\u0647\u064a\u0629 \u0627\u0644\u0646\u0639\u0645\u0629 \u0639\u0644\u0649 \u0627\u0644\u063a\u064a\u0631.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0645\u0650\u0646\u0652 \u0634\u064e\u0631\u0651\u0650 \u062d\u064e\u0627\u0633\u0650\u062f\u064d \u0625\u0650\u0630\u064e\u0627 \u062d\u064e\u0633\u064e\u062f\u064e 5\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0641\u0644\u0642: \u0665].\n\u0648\u0639\u0646 \u0623\u0646\u0633\u0650 \u0628\u0646\u0650 \u0645\u0627\u0644\u0643\u064d \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u060c \u0623\u0646\u0651\u064e \u0631\u0633\u0648\u0644\u064e \u0627\u0644\u0644\u0647\u0650 \ufdfa \u0642\u0627\u0644: \xab\u0644\u0627 \u062a\u064e\u0628\u0627\u063a\u064e\u0636\u064f\u0648\u0627\u060c \u0648\u0644\u0627 \u062a\u064e\u062d\u0627\u0633\u064e\u062f\u064f\u0648\u0627\u060c \u0648\u0644\u0627 \u062a\u064e\u062f\u0627\u0628\u064e\u0631\u064f\u0648\u0627\u060c \u0648\u0643\u064f\u0648\u0646\u0648\u0627 -\u0639\u0650\u0628\u0627\u062f\u064e \u0627\u0644\u0644\u0647\u0650- \u0625\u062e\u0648\u0627\u0646\u064b\u0627\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u0628\u062e\u0627\u0631\u064a \u0648\u0645\u0633\u0644\u0645.                    ","\n                    \u062c- \u0647\u0648 \u0627\u0644\u0633\u062e\u0631\u064a\u0629 \u0645\u0646 \u0623\u062e\u064a\u0643 \u0627\u0644\u0645\u0633\u0644\u0645 \u0648\u062a\u062d\u0642\u064a\u0631\u0647\u060c \u0648\u0647\u0630\u0627 \u0644\u0627 \u064a\u062c\u0648\u0632.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0641\u064a \u0627\u0644\u0646\u0647\u064a \u0639\u0646 \u0630\u0644\u0643: \ufd3f\u064a\u064e\u0627 \u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0622\u064e\u0645\u064e\u0646\u064f\u0648\u0627 \u0644\u064e\u0627 \u064a\u064e\u0633\u0652\u062e\u064e\u0631\u0652 \u0642\u064e\u0648\u0645\u064c \u0645\u0650\u0646\u0652 \u0642\u064e\u0648\u0652\u0645\u064d \u0639\u064e\u0633\u064e\u0649 \u0623\u064e\u0646\u0652 \u064a\u064e\u0643\u064f\u0648\u0646\u064f\u0648\u0627 \u062e\u064e\u064a\u0652\u0631\u064b\u0627 \u0645\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u0646\u0650\u0633\u064e\u0627\u0621\u064c \u0645\u0650\u0646\u0652 \u0646\u0650\u0633\u064e\u0627\u0621\u064d \u0639\u064e\u0633\u064e\u0649 \u0623\u064e\u0646\u0652 \u064a\u064e\u0643\u064f\u0646\u0651\u064e \u062e\u064e\u064a\u0652\u0631\u064b\u0627 \u0645\u0650\u0646\u0652\u0647\u064f\u0646\u0651\u064e \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0644\u0652\u0645\u0650\u0632\u064f\u0648\u0627 \u0623\u064e\u0646\u0652\u0641\u064f\u0633\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0646\u064e\u0627\u0628\u064e\u0632\u064f\u0648\u0627 \u0628\u0650\u0627\u0644\u0652\u0623\u064e\u0644\u0652\u0642\u064e\u0627\u0628\u0650 \u0628\u0650\u0626\u0652\u0633\u064e \u0627\u0644\u0650\u0627\u0633\u0652\u0645\u064f \u0627\u0644\u0652\u0641\u064f\u0633\u064f\u0648\u0642\u064f \u0628\u064e\u0639\u0652\u062f\u064e \u0627\u0644\u0652\u0625\u0650\u064a\u0645\u064e\u0627\u0646\u0650 \u0648\u064e\u0645\u064e\u0646\u0652 \u0644\u064e\u0645\u0652 \u064a\u064e\u062a\u064f\u0628\u0652 \u0641\u064e\u0623\u064f\u0648\u0644\u064e\u0626\u0650\u0643\u064e \u0647\u064f\u0645\u064f \u0627\u0644\u0638\u0651\u064e\u0627\u0644\u0650\u0645\u064f\u0648\u0646\u064e 11\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u062d\u062c\u0631\u0627\u062a: \u0661\u0661].                    ","\n                    \u062c- \u0647\u0648 \u0623\u0646 \u0644\u0627 \u064a\u0631\u0649 \u0627\u0644\u0625\u0646\u0633\u0627\u0646 \u0646\u0641\u0633\u0647 \u0639\u0644\u0649 \u0627\u0644\u0646\u0627\u0633\u060c \u0641\u0644\u0627 \u064a\u0633\u062a\u062d\u0642\u0631 \u0627\u0644\u0646\u0627\u0633 \u0648\u0644\u0627 \u064a\u0631\u0641\u0636 \u0627\u0644\u062d\u0642.\n- \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0639\u0650\u0628\u064e\u0627\u062f\u064f \u0627\u0644\u0631\u0651\u064e\u062d\u0652\u0645\u064e\u0646\u0650 \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064e\u0645\u0652\u0634\u064f\u0648\u0646\u064e \u0639\u064e\u0644\u064e\u0649 \u0627\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u0647\u064e\u0648\u0652\u0646\u064b\u0627\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0641\u0631\u0642\u0627\u0646: \u0666\u0663]\u060c \u0623\u064a: \u0645\u062a\u0648\u0627\u0636\u0639\u064a\u0646. - \u0648\u0642\u0627\u0644\u064e \u0631\u0633\u0648\u0644\u064f \u0627\u0644\u0644\u0647\u0650 \ufdfa : \xab\u0648\u0645\u0627 \u062a\u064e\u0648\u0627\u0636\u064e\u0639\u064e \u0623\u062d\u064e\u062f\u064c \u0644\u0644\u0647\u0650 \u0625\u0644\u0651\u064e\u0627 \u0631\u064e\u0641\u064e\u0639\u064e\u0647\u064f \u0627\u0644\u0644\u0647\u064f\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645. - \u0648\u0642\u0627\u0644 \ufdfa : \xab\u0625\u0646\u0651\u064e \u0627\u0644\u0644\u0647\u064e \u0623\u064e\u0648\u0652\u062d\u0649 \u0625\u0644\u064a\u0651\u064e \u0623\u0646\u0652 \u062a\u064e\u0648\u0627\u0636\u064e\u0639\u064f\u0648\u0627\u060c \u062d\u062a\u0651\u064e\u0649 \u0644\u0627 \u064a\u064e\u0641\u062e\u064e\u0631\u064e \u0623\u062d\u064e\u062f\u064c \u0639\u0644\u0649 \u0623\u062d\u064e\u062f\u064d\u060c \u0648\u0644\u0627 \u064a\u064e\u0628\u0652\u063a\u064a\u064e \u0623\u062d\u064e\u062f\u064c \u0639\u0644\u0649 \u0623\u062d\u064e\u062f\u064d\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.                    ","\n                    \u062c- \u0661- \u0627\u0644\u0643\u0650\u0628\u0652\u0631 \u0639\u0644\u0649 \u0627\u0644\u062d\u0642\u060c \u0648\u0647\u0648 \u0631\u062f \u0627\u0644\u062d\u0642 \u0648\u0639\u062f\u0645 \u0642\u0628\u0648\u0644\u0647.\n\u0662- \u0627\u0644\u0643\u0650\u0628\u0652\u0631\u064f \u0639\u0644\u0649 \u0627\u0644\u0646\u0627\u0633\u060c \u0648\u0647\u0648 \u0627\u0633\u062a\u062d\u0642\u0627\u0631\u0647\u0645 \u0648\u0627\u0644\u0627\u0633\u062a\u0647\u0627\u0646\u0629 \u0628\u0647\u0645.\n\u0642\u0627\u0644 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa : \xab\u0644\u0627 \u064a\u064e\u062f\u062e\u064f\u0644\u064f \u0627\u0644\u062c\u064e\u0646\u0651\u064e\u0629\u064e \u0645\u064e\u0646 \u0643\u0627\u0646 \u0641\u064a \u0642\u064e\u0644\u0628\u0650\u0647 \u0645\u0650\u062b\u0652\u0642\u0627\u0644\u064f \u0630\u064e\u0631\u0651\u064e\u0629\u064d \u0645\u0650\u0646 \u0643\u0650\u0628\u0652\u0631\u064d\xbb. \u0641\u0642\u0627\u0644 \u0631\u064e\u062c\u064f\u0644\u064c: \u0625\u0646\u0651\u064e \u0627\u0644\u0631\u0651\u064e\u062c\u064f\u0644\u064e \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0623\u0646 \u064a\u064e\u0643\u0648\u0646\u064e \u062b\u064e\u0648\u0628\u064f\u0647 \u062d\u0633\u064e\u0646\u064b\u0627\u060c \u0648\u0646\u064e\u0639\u0652\u0644\u064f\u0647 \u062d\u0633\u064e\u0646\u0629\u064b\u061f \u0642\u0627\u0644: \xab\u0625\u0646\u0651\u064e \u0627\u0644\u0644\u0647\u064e \u062c\u064e\u0645\u064a\u0644\u064c \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0627\u0644\u062c\u064e\u0645\u0627\u0644\u064e\u060c \u0627\u0644\u0643\u0650\u0628\u0652\u0631\u064f: \u0628\u064e\u0637\u064e\u0631\u064f \u0627\u0644\u062d\u064e\u0642\u0651\u0650\u060c \u0648\u064e\u063a\u064e\u0645\u0652\u0637\u064f \u0627\u0644\u0646\u0651\u064e\u0627\u0633\u0650\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.\n- \u0628\u064e\u0637\u064e\u0631\u064f \u0627\u0644\u062d\u064e\u0642\u0651\u0650: \u0631\u062f\u0647\n- \u063a\u064e\u0645\u0652\u0637\u064f \u0627\u0644\u0646\u0651\u064e\u0627\u0633\u0650: \u0627\u0633\u062a\u062d\u0642\u0627\u0631\u0647\u0645\n- \u0627\u0644\u062b\u0648\u0628 \u0627\u0644\u062d\u0633\u0646 \u0648\u0627\u0644\u0646\u0639\u0644 \u0627\u0644\u062d\u0633\u0646 \u0644\u064a\u0633 \u0645\u0646 \u0627\u0644\u0643\u0628\u0631.                    ","\n                    \u062c- \u0627\u0644\u063a\u0634 \u0641\u064a \u0627\u0644\u0628\u064a\u0639 \u0648\u0627\u0644\u0634\u0631\u0627\u0621\u060c \u0648\u0647\u0648 \u0625\u062e\u0641\u0627\u0621 \u0639\u064a\u0628 \u0627\u0644\u0633\u0644\u0639\u0629.\n- \u0627\u0644\u063a\u0634 \u0641\u064a \u062a\u0639\u0644\u0645 \u0627\u0644\u0639\u0644\u0645\u060c \u0648\u0645\u062b\u0644 \u0630\u0644\u0643 \u063a\u0634 \u0627\u0644\u0637\u0644\u0627\u0628 \u0641\u064a \u0627\u0644\u0627\u0645\u062a\u062d\u0627\u0646\u0627\u062a.\n- \u0627\u0644\u063a\u0634 \u0641\u064a \u0627\u0644\u0642\u0648\u0644 \u0643\u0634\u0647\u0627\u062f\u0629 \u0627\u0644\u0632\u0648\u0631 \u0648\u0627\u0644\u0643\u0630\u0628.\n- \u0639\u062f\u0645 \u0627\u0644\u0648\u0641\u0627\u0621 \u0628\u0645\u0627 \u062a\u0642\u0648\u0644 \u0648\u0645\u0627 \u062a\u062a\u0641\u0642 \u0628\u0647 \u0645\u0639 \u0627\u0644\u0646\u0627\u0633.\n\u0648\u0641\u064a \u0627\u0644\u0646\u0647\u064a \u0639\u0646 \u0627\u0644\u063a\u0634\u060c \u0623\u0646\u0651\u064e \u0631\u0633\u0648\u0644\u064e \u0627\u0644\u0644\u0647\u0650 \ufdfa \u0645\u0631\u064e\u0651 \u0639\u0644\u0649 \u0635\u064f\u0628\u0652\u0631\u0629\u0650 \u0637\u0639\u0627\u0645\u064d\u060c \u0641\u0623\u064e\u062f\u062e\u064e\u0644\u064e \u064a\u062f\u064e\u0647 \u0641\u064a\u0647\u0627\u060c \u0641\u0646\u0627\u0644\u064e\u062a\u0652 \u0623\u0635\u0627\u0628\u0639\u064f\u0647 \u0628\u064e\u0644\u064e\u0644\u064b\u0627\u060c \u0641\u0642\u0627\u0644: \xab\u0645\u0627 \u0647\u0630\u0627 \u064a\u0627 \u0635\u0627\u062d\u0650\u0628\u064e \u0627\u0644\u0637\u0651\u064e\u0639\u0627\u0645\u0650\u061f\xbb \u0642\u0627\u0644: \u0623\u0635\u0627\u0628\u064e\u062a\u0652\u0647\u064f \u0627\u0644\u0633\u0651\u064e\u0645\u0627\u0621\u064f \u064a\u0627 \u0631\u0633\u0648\u0644\u064e \u0627\u0644\u0644\u0647\u0650. \u0642\u0627\u0644: \xab\u0623\u0641\u0644\u0627 \u062c\u064e\u0639\u064e\u0644\u0652\u062a\u064e\u0647 \u0641\u064e\u0648\u0642\u064e \u0627\u0644\u0637\u0651\u064e\u0639\u0627\u0645\u0650 \u0643\u064e\u064a\u0652 \u064a\u064e\u0631\u0627\u0647\u064f \u0627\u0644\u0646\u0651\u064e\u0627\u0633\u064f\u061f \u0645\u064e\u0646 \u063a\u064e\u0634\u0651\u064e \u0641\u0644\u064a\u0633 \u0645\u0650\u0646\u0650\u0651\u064a\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.\n\u0627\u0644\u0635\u0651\u064f\u0628\u0652\u0631\u064e\u0629: \u0647\u064a \u0627\u0644\u0643\u064e\u0648\u0652\u0645\u0629\u064f \u0645\u0646 \u0627\u0644\u0637\u0651\u064e\u0639\u0627\u0645.                    ","\n                    \u062c- \u0647\u064a \u0630\u0643\u0631 \u0623\u062e\u0627\u0643 \u0627\u0644\u0645\u0633\u0644\u0645 \u0628\u0645\u0627 \u064a\u0643\u0631\u0647 \u0648\u0647\u0648 \u063a\u0627\u0626\u0628.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u063a\u0652\u062a\u064e\u0628\u0652 \u0628\u064e\u0639\u0652\u0636\u064f\u0643\u064f\u0645\u0652 \u0628\u064e\u0639\u0652\u0636\u064b\u0627 \u0623\u064e\u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0623\u064e\u062d\u064e\u062f\u064f\u0643\u064f\u0645\u0652 \u0623\u064e\u0646\u0652 \u064a\u064e\u0623\u0652\u0643\u064f\u0644\u064e \u0644\u064e\u062d\u0652\u0645\u064e \u0623\u064e\u062e\u0650\u064a\u0647\u0650 \u0645\u064e\u064a\u0652\u062a\u064b\u0627 \u0641\u064e\u0643\u064e\u0631\u0650\u0647\u0652\u062a\u064f\u0645\u064f\u0648\u0647\u064f \u0648\u064e\u0627\u062a\u0651\u064e\u0642\u064f\u0648\u0627 \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u062a\u064e\u0648\u0651\u064e\u0627\u0628\u064c \u0631\u064e\u062d\u0650\u064a\u0645\u064c 12\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u062d\u062c\u0631\u0627\u062a: \u0661\u0662].                    ","\n                    \u062c- \u0647\u064a \u0646\u0642\u0644 \u0627\u0644\u0623\u062d\u0627\u062f\u064a\u062b \u0628\u064a\u0646 \u0627\u0644\u0646\u0627\u0633 \u0644\u0644\u0625\u0641\u0633\u0627\u062f \u0628\u064a\u0646\u0647\u0645.\n- \u0642\u0627\u0644 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa : \xab\u0644\u0627 \u064a\u064e\u062f\u062e\u064f\u0644\u064f \u0627\u0644\u062c\u064e\u0646\u0651\u064e\u0629\u064e \u0646\u064e\u0645\u0651\u064e\u0627\u0645\u064c\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.                    ","\n                    \u062c- \u0647\u0648 \u0627\u0644\u062a\u062b\u0627\u0642\u0644 \u0639\u0646 \u0641\u0639\u0644 \u0627\u0644\u062e\u064a\u0631 \u0648\u0645\u0627 \u064a\u062c\u0628 \u0639\u0644\u0649 \u0627\u0644\u0625\u0646\u0633\u0627\u0646 \u0641\u0639\u0644\u0647.\n\u0648\u0645\u0646 \u0630\u0644\u0643: \u0627\u0644\u062a\u0643\u0627\u0633\u0644 \u0641\u064a \u0641\u0639\u0644 \u0627\u0644\u0648\u0627\u062c\u0628\u0627\u062a.\n\u0642\u0627\u0644 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0652\u0645\u064f\u0646\u064e\u0627\u0641\u0650\u0642\u0650\u064a\u0646\u064e \u064a\u064f\u062e\u064e\u0627\u062f\u0650\u0639\u064f\u0648\u0646\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0647\u064f\u0648\u064e \u062e\u064e\u0627\u062f\u0650\u0639\u064f\u0647\u064f\u0645\u0652 \u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0642\u064e\u0627\u0645\u064f\u0648\u0627 \u0625\u0650\u0644\u064e\u0649 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u0650 \u0642\u064e\u0627\u0645\u064f\u0648\u0627 \u0643\u064f\u0633\u064e\u0627\u0644\u064e\u0649 \u064a\u064f\u0631\u064e\u0627\u0621\u064f\u0648\u0646\u064e \u0627\u0644\u0646\u0651\u064e\u0627\u0633\u064e \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0646\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0642\u064e\u0644\u0650\u064a\u0644\u064b\u0627 142\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u0633\u0627\u0621: \u0661\u0664\u0662].\n\u0641\u064a\u0646\u0628\u063a\u064a \u0644\u0644\u0645\u0624\u0645\u0646 \u062a\u0631\u0643 \u0627\u0644\u0643\u0633\u0644 \u0648\u0627\u0644\u062e\u0645\u0648\u0644 \u0648\u0627\u0644\u0642\u0639\u0648\u062f\u060c \u0648\u0627\u0644\u0633\u0639\u064a \u0641\u064a \u0627\u0644\u0639\u0645\u0644 \u0648\u0627\u0644\u062d\u0631\u0643\u0629 \u0648\u0627\u0644\u062c\u062f \u0648\u0627\u0644\u0627\u062c\u062a\u0647\u0627\u062f \u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u062d\u064a\u0627\u0629 \u0628\u0645\u0627 \u064a\u0631\u0636\u064a \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.                    ","\n                    \u062c- \u0661- \u063a\u0636\u0628 \u0645\u062d\u0645\u0648\u062f: \u0648\u0647\u0648 \u0623\u0646 \u064a\u0643\u0648\u0646 \u0644\u0644\u0647 \u0625\u0630\u0627 \u0627\u0646\u062a\u0647\u0643 \u0627\u0644\u0643\u0641\u0627\u0631 \u0623\u0648 \u0627\u0644\u0645\u0646\u0627\u0641\u0642\u0648\u0646 \u0623\u0648 \u063a\u064a\u0631\u0647\u0645 \u062d\u0631\u0645\u0627\u062a\u0647 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f.\n\u0662- \u063a\u0636\u0628 \u0645\u0630\u0645\u0648\u0645: \u0648\u0647\u0648 \u0627\u0644\u063a\u0636\u0628 \u0627\u0644\u0630\u064a \u064a\u062c\u0639\u0644 \u0627\u0644\u0625\u0646\u0633\u0627\u0646 \u064a\u0639\u0645\u0644 \u0648\u064a\u0642\u0648\u0644 \u0645\u0627 \u0644\u0627 \u064a\u0646\u0628\u063a\u064a.\n\u0639\u0644\u0627\u062c \u0627\u0644\u063a\u0636\u0628 \u0627\u0644\u0645\u0630\u0645\u0648\u0645:\n\u0627\u0644\u0648\u064f\u0636\u0648\u0621\u064f.\n\u0627\u0644\u0642\u064f\u0639\u0648\u062f\u064f \u0625\u0646\u0652 \u0643\u0627\u0646 \u0642\u0627\u0626\u0645\u064b\u0627\u060c \u0648\u0627\u0644\u0627\u0636\u0652\u0637\u0650\u062c\u0627\u0639\u064f \u0625\u0646 \u0643\u0627\u0646 \u0642\u0627\u0639\u062f\u064b\u0627.\n\u0623\u0646 \u064a\u064e\u0644\u062a\u0632\u0650\u0645\u064e \u0628\u0648\u0635\u064a\u0651\u064e\u0629\u0650 \u0627\u0644\u0646\u0651\u064e\u0628\u064a\u0651\u0650 \ufdfa \u0641\u064a \u0630\u0644\u0643: \xab\u0644\u0627 \u062a\u064e\u063a\u0636\u064e\u0628\u0652\xbb.\n\u0623\u0646 \u064a\u064e\u0636\u0628\u0650\u0637\u064e \u0627\u0644\u0646\u0651\u064e\u0641\u0652\u0633\u064e \u0639\u0646\u0650 \u0627\u0644\u0627\u0646\u062f\u0641\u0627\u0639\u0650 \u0639\u0646\u062f \u0627\u0644\u063a\u0636\u0628\u0650.\n\u0627\u0644\u0627\u0633\u062a\u0639\u0627\u0630\u0629\u064f \u0628\u0627\u0644\u0644\u0647\u0650 \u0645\u0650\u0646\u064e \u0627\u0644\u0634\u0651\u064e\u064a\u0637\u0627\u0646\u0650 \u0627\u0644\u0631\u0651\u064e\u062c\u064a\u0645\u0650.\n\u0627\u0644\u0633\u0651\u064f\u0643\u0648\u062a\u064f.                    ","\n                    \u062c- \u0647\u0648 \u0627\u0644\u0643\u0634\u0641 \u0648\u0627\u0644\u0628\u062d\u062b \u0639\u0646 \u0639\u0648\u0631\u0627\u062a \u0627\u0644\u0646\u0627\u0633 \u0648\u0645\u0627 \u064a\u0633\u062a\u0631\u0648\u0646\u0647.\n\u0645\u0646 \u0635\u0648\u0631\u0647 \u0627\u0644\u0645\u062d\u0631\u0645\u0629:\n- \u0627\u0644\u0627\u0637\u0644\u0627\u0639 \u0639\u0644\u0649 \u0639\u0648\u0631\u0627\u062a \u0627\u0644\u0646\u0627\u0633 \u0641\u064a \u0627\u0644\u0628\u064a\u0648\u062a.\n- \u0627\u0633\u062a\u0645\u0627\u0639 \u0627\u0644\u0645\u0631\u0621 \u0625\u0644\u0649 \u062d\u062f\u064a\u062b \u0642\u0648\u0645 \u0628\u062f\u0648\u0646 \u0639\u0644\u0645\u0647\u0645.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u062c\u064e\u0633\u0651\u064e\u0633\u064f\u0648\u0627 ...\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u062d\u062c\u0631\u0627\u062a: \u0661\u0662].                    ","\n                    \u062c- \u0627\u0644\u0625\u0633\u0631\u0627\u0641: \u0647\u0648 \u0625\u0646\u0641\u0627\u0642 \u0627\u0644\u0645\u0627\u0644 \u0628\u063a\u064a\u0631 \u062d\u0642\u0647\u060c\n\u0648\u0639\u0643\u0633\u0647: \u0627\u0644\u0628\u062e\u0644: \u0648\u0647\u0648 \u0627\u0644\u0625\u0645\u0633\u0627\u0643 \u0639\u0646 \u062d\u0642\u0647.\n\u0648\u0627\u0644\u0635\u062d\u064a\u062d \u0647\u0648 \u0627\u0644\u0648\u0633\u0637 \u0628\u064a\u0646\u0647\u0645\u0627\u060c \u0648\u0623\u0646 \u064a\u0643\u0648\u0646 \u0627\u0644\u0645\u0633\u0644\u0645 \u0643\u0631\u064a\u0645\u0627\u064b.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0625\u0650\u0630\u064e\u0627\u06e4 \u0623\u064e\u0646\u0641\u064e\u0642\u064f\u0648\u0627 \u0644\u064e\u0645\u06e1 \u064a\u064f\u0633\u06e1\u0631\u0650\u0641\u064f\u0648\u0627 \u0648\u064e\u0644\u064e\u0645\u06e1 \u064a\u064e\u0642\u06e1\u062a\u064f\u0631\u064f\u0648\u0627 \u0648\u064e\u0643\u064e\u0627\u0646\u064e \u0628\u064e\u064a\u06e1\u0646\u064e \u0630\u064e\u200a\u0644\u0650\u0643\u064e \u0642\u064e\u0648\u064e\u0627\u0645\u064b\u0627 67\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0641\u0631\u0642\u0627\u0646 \u0666\u0667].                    ","\n                    \u062c- \u0627\u0644\u062c\u0628\u0646: \u0623\u0646 \u064a\u062e\u0627\u0641 \u0645\u0645\u0627 \u0644\u0627 \u064a\u0646\u0628\u063a\u064a \u0623\u0646 \u064a\u062e\u0627\u0641 \u0645\u0646\u0647.\n\u0645\u062b\u0644 \u0627\u0644\u062e\u0648\u0641 \u0645\u0646 \u0642\u0648\u0644 \u0627\u0644\u062d\u0642 \u0648\u0625\u0646\u0643\u0627\u0631 \u0627\u0644\u0645\u0646\u0643\u0631.\n\u0627\u0644\u0634\u062c\u0627\u0639\u0629: \u0648\u0647\u064a \u0627\u0644\u0625\u0642\u062f\u0627\u0645 \u0639\u0644\u0649 \u0627\u0644\u062d\u0642\u060c \u0648\u0630\u0644\u0643 \u0645\u062b\u0644 \u0627\u0644\u0625\u0642\u062f\u0627\u0645 \u0641\u064a \u0633\u0627\u062d\u0627\u062a \u0627\u0644\u062c\u0647\u0627\u062f \u0644\u0644\u062f\u0641\u0627\u0639 \u0639\u0646 \u0627\u0644\u0625\u0633\u0644\u0627\u0645 \u0648\u0627\u0644\u0645\u0633\u0644\u0645\u064a\u0646.\n\u0648\u0643\u0627\u0646 \u0627\u0644\u0646\u0628\u064a \ufdfa \u0641\u064a \u062f\u0639\u0627\u0626\u0647 \u064a\u0642\u0648\u0644: \xab\u0627\u0644\u0644\u0651\u064e\u0647\u064f\u0645\u0651\u064e \u0625\u0646\u0651\u0650\u064a \u0623\u0639\u0648\u0630\u064f \u0628\u0643\u064e \u0645\u0646 \u0627\u0644\u062c\u064f\u0628\u0646\u0650...\xbb. \u0648\u0642\u0627\u0644 \u0631\u0633\u0648\u0644\u064f \u0627\u0644\u0644\u0647\u0650 \ufdfa : \xab\u0627\u0644\u0645\u0624\u0645\u0646\u064f \u0627\u0644\u0642\u0648\u064a\u0651\u064f \u062e\u064a\u0631\u064c \u0648\u0623\u062d\u0628\u0651\u064f \u0625\u0644\u0649 \u0627\u0644\u0644\u0647\u0650 \u0645\u0650\u0646 \u0627\u0644\u0645\u0624\u0645\u0646\u0650 \u0627\u0644\u0636\u0651\u064e\u0639\u064a\u0641\u0650\u060c \u0648\u0641\u064a \u0643\u064f\u0644\u0651\u064d \u062e\u064a\u0631\u064c\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.                    ",'\n                    \u062c- - \u0645\u062b\u0644 \u0627\u0644\u0644\u0639\u0646 \u0648\u0627\u0644\u0633\u0628\u0627\u0628.\n- \u0648\u0645\u062b\u0644 \u0642\u0648\u0644 \u0641\u0644\u0627\u0646 " \u062d\u064a\u0648\u0627\u0646 " \u0623\u0648 \u0645\u062b\u0644\u0647\u0627 \u0645\u0646 \u0627\u0644\u0623\u0644\u0641\u0627\u0638.\n- \u0623\u0648 \u0630\u0643\u0631 \u0627\u0644\u0639\u0648\u0631\u0627\u062a \u0645\u0646 \u0643\u0644\u0645\u0627\u062a \u0627\u0644\u0641\u062d\u0634 \u0648\u0627\u0644\u0628\u0630\u0627\u0621\u0629.\n- \u0648\u0642\u062f \u0646\u0647\u0649 \u0627\u0644\u0646\u0628\u064a \ufdfa \u0639\u0646 \u0630\u0644\u0643 \u0643\u0644\u0647\u060c \u0641\u0642\u0627\u0644: \xab\u0644\u064a\u0633 \u0627\u0644\u0645\u0624\u0652\u0645\u0650\u0646\u064f \u0628\u0627\u0644\u0637\u0651\u064e\u0639\u0651\u064e\u0627\u0646\u0650\u060c \u0648\u0644\u0627 \u0627\u0644\u0644\u0651\u064e\u0639\u0651\u064e\u0627\u0646\u0650\u060c \u0648\u0644\u0627 \u0627\u0644\u0641\u0627\u062d\u0650\u0634\u0650\u060c \u0648\u0644\u0627 \u0627\u0644\u0628\u064e\u0630\u064a\u0621\u0650\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u062a\u0631\u0645\u0630\u064a \u0648\u0627\u0628\u0646 \u062d\u0628\u0627\u0646.                    ',"\n                    \u062c- \u0661- \u0627\u0644\u062f\u0639\u0627\u0621 \u0628\u0623\u0646 \u064a\u0631\u0632\u0642\u0643 \u0627\u0644\u0644\u0647 \u062d\u0633\u0646 \u0627\u0644\u062e\u0644\u0642 \u0648\u064a\u0639\u064a\u0646\u0643 \u0639\u0644\u064a\u0647.\n\u0662- \u0645\u0631\u0627\u0642\u0628\u0629 \u0627\u0644\u0644\u0647 \u0639\u064e\u0632\u0651\u064e \u0648\u064e\u062c\u064e\u0644\u0651\u064e\u060c \u0648\u0623\u0646\u0647 \u064a\u0639\u0644\u0645 \u0628\u0643 \u0648\u064a\u0633\u0645\u0639\u0643 \u0648\u064a\u0631\u0627\u0643.\n\u0663- \u062a\u0630\u0643\u0631 \u062b\u0648\u0627\u0628 \u062d\u0633\u0646 \u0627\u0644\u062e\u0644\u0642 \u0648\u0623\u0646\u0647 \u0633\u0628\u0628 \u0644\u062f\u062e\u0648\u0644 \u0627\u0644\u062c\u0646\u0629.\n\u0664- \u062a\u0630\u0643\u0631 \u0639\u0627\u0642\u0628\u0629 \u0633\u0648\u0621 \u0627\u0644\u062e\u0644\u0642 \u0648\u0623\u0646\u0647 \u0633\u0628\u0628 \u0644\u062f\u062e\u0648\u0644 \u0641\u064a \u0627\u0644\u0646\u0627\u0631.\n\u0665- \u0623\u0646 \u062d\u0633\u0646 \u0627\u0644\u062e\u064f\u0644\u0642 \u064a\u062c\u0644\u0628 \u0645\u062d\u0628\u0629 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0648\u0645\u062d\u0628\u0629 \u062e\u0644\u0642\u0647\u060c \u0648\u0623\u0646 \u0633\u0648\u0621 \u0627\u0644\u062e\u064f\u0644\u0642 \u064a\u062c\u0644\u0628 \u0628\u063a\u0636 \u0627\u0644\u0644\u0647 \u0648\u0628\u063a\u0636 \u062e\u0644\u0642\u0647.\n\u0666- \u0642\u0631\u0627\u0621\u0629 \u0633\u064a\u0631\u0629 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f \u0648\u0627\u0644\u0627\u0642\u062a\u062f\u0627\u0621 \u0628\u0647.\n\u0667- \u0645\u0635\u0627\u062d\u0628\u0629 \u0627\u0644\u0623\u062e\u064a\u0627\u0631 \u0648\u062a\u062c\u0646\u0628 \u0635\u062d\u0628\u0629 \u0627\u0644\u0623\u0634\u0631\u0627\u0631.                    "]),t.s)
